// Initialization function prototypes
depthwise_conv2d_layer_t init_depthwise_conv2d_data(void);
conv2d_layer_t init_conv2d_data(void);
depthwise_conv2d_layer_t init_depthwise_conv2d_1_data(void);
conv2d_layer_t init_conv2d_1_data(void);
dense_layer_t init_dense_data(void);
dense_layer_t init_dense_1_data(void);


// Global Variables
depthwise_conv2d_layer_t depthwise_conv2d_data;
conv2d_layer_t conv2d_data;
depthwise_conv2d_layer_t depthwise_conv2d_1_data;
conv2d_layer_t conv2d_1_data;
dense_layer_t dense_data;
dense_layer_t dense_1_data;


void model_init(){
    depthwise_conv2d_data = init_depthwise_conv2d_data();
    conv2d_data = init_conv2d_data();
    depthwise_conv2d_1_data = init_depthwise_conv2d_1_data();
    conv2d_1_data = init_conv2d_1_data();
    dense_data = init_dense_data();
    dense_1_data = init_dense_1_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    prepare_buffers();
    
    //******************** LAYER 0 *******************//
    // Layer name: depthwise_conv2d
    data3d_t output0;
    depthwise_conv2d_layer(depthwise_conv2d_data, input, &output0);
    // Activation layer for depthwise_conv2d
    relu_activation(output0.data, 144);
    // Debug function for layer depthwise_conv2d
    print_data3d_t("depthwise_conv2d", output0);
    
    //******************** LAYER 1 *******************//
    // Layer name: conv2d
    input = output0;
    conv2d_layer(conv2d_data, input, &output0);
    // Activation layer for conv2d
    relu_activation(output0.data, 4608);
    // Debug function for layer conv2d
    print_data3d_t("conv2d", output0);
    
    //******************** LAYER 2 *******************//
    // Layer name: depthwise_conv2d_1
    input = output0;
    depthwise_conv2d_layer(depthwise_conv2d_1_data, input, &output0);
    // Activation layer for depthwise_conv2d_1
    relu_activation(output0.data, 3200);
    // Debug function for layer depthwise_conv2d_1
    print_data3d_t("depthwise_conv2d_1", output0);
    
    //******************** LAYER 3 *******************//
    // Layer name: conv2d_1
    input = output0;
    conv2d_layer(conv2d_1_data, input, &output0);
    // Activation layer for conv2d_1
    relu_activation(output0.data, 6400);
    // Debug function for layer conv2d_1
    print_data3d_t("conv2d_1", output0);
    
    //******************** LAYER 4 *******************//
    // Layer name: max_pooling2d
    input = output0;
    static const pooling2d_layer_t max_pooling2d_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_data, input, &output0);
    // Debug function for layer max_pooling2d
    print_data3d_t("max_pooling2d", output0);
    
    //******************** LAYER 5 *******************//
    // Layer name: flatten
    input = output0;
    data1d_t output1;
    flatten3d_layer(input, &output1);
    // Debug function for layer flatten
    print_data1d_t("flatten", output1);
    
    //******************** LAYER 6 *******************//
    // Layer name: dense
    data1d_t input1;
    input1 = output1;
    dense_layer(dense_data, input1, &output1);
    
    // Activation layer for dense
    relu_activation(output1.data, 128);
    // Debug function for layer dense
    print_data1d_t("dense", output1);
    
    //******************** LAYER 7 *******************//
    // Layer name: dense_1
    input1 = output1;
    dense_layer(dense_1_data, input1, &output1);
    
    // Activation layer for dense_1
    softmax_activation(output1.data, 10);
    // Debug function for layer dense_1
    print_data1d_t("dense_1", output1);
    

    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

